import React, {Component} from 'react';
import Slideout from 'slideout';


import MainUI from './Components/MainUI';
import SlideInTrigger from './Components/SlideInTrigger';
import SlideIn from './Components/SlideIn';

import Modal from './Components/MainUI';


import './CSS/monkeypuzzle.css';
//import './CSS/font-awesome.min.css';
import './CSS/cytoscape-context-menus.css';
//import './CSS/jquery.qtip.min.css';
//import './CSS/bootstrap.min.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import './CSS/App.css';


var FontAwesome = require('react-fontawesome');








class App extends Component{

	toggleButton(){
        this.slideout.toggle();
	}

 	componentDidMount() {
  	this.slideout = new Slideout({
    'panel': document.getElementById('panel'),
    'menu': document.getElementById('menu'),
    "fx": "ease",
    "side": "right",
    "duration": 500,
    "padding": 256,
    "tolerance": 70

  });
}

  render(){

    return (
    	<div>

    	<SlideIn />



    {/* Main UI: START */} 

    <main id="panel" className="panel">
    <div className="ui-container">
        <div className="resource-pane" id="resource-pane">
            <div className="resource_pane_tab_head" id="resource_pane_tab_head">
                <button id="add_tab_button" className="add_tab_button" onClick="$('#resource_pane_selection_modal').modal('show');"> 
                    <i className="fa fa-plus-square fa-lg" style={{color: "#cbc5c1"}}></i>
                </button>
            </div>
            <div className="tab_body" id="tab_body"></div>        
        </div>

        <div className="splitter" id="splitter">
        </div>

        <div className="visualisation-pane">
            <div id="navbar">

                <SlideInTrigger
					className="btn-hamburger toggle-button"
                	onClick={() => this.toggleButton()}
                />
            </div>
            <div id="cy" onDrop="drop_handler(event);" onDragover="dragover_handler(event);"></div>
        </div>
    </div>
    </main>

   {/* Main UI: END */}
   </div>

      );
  }
}






















export default App;
